import React from "react";
// import Header from "./header";
import Scripts from "./bottomContainer";
import MediaCard from "./Card";
import HeadTag from "./HeadTag";
import Button from '@mui/material/Button';
import ArrowBackIcon from '@mui/icons-material/ArrowBack';
// import dataSet from "./dataSet";

class Project extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            items: null,
            isLoaded: false,
        };
    }

    componentDidMount() {
        fetch("http://localhost:3001/api", {
            headers: {
                'Content-Type': 'application/json',
                'Accept': 'application/json'
            }
        })
            .then(res => res.json())
            .then(result => {
                this.setState({
                    isLoaded: true,
                    items: result
                });
            });
    }

    render() {

        const fullDiv = {
            "margin": "10%",
        };

        const anchorStyle = {
            "textDecoration": "none"
        };

        const { items } = this.state;
        if (!this.state.isLoaded) {
            return <div>Loading ... </div>;
        } else {

            return (

                <div>
                    <HeadTag Title="Python" />
                    <div className="container-fluid">

                        <div style={fullDiv} className="row">

                            {/* {allData.map(function(object, i) { */}

                            {/* { allProjects !== null ? ( 
                        console.log(allProjects) 
                        ): (
                            allProjects = dataSet()
                        )} */}
                            <p> {Object.keys(items.docs)} </p>
                            <div className="col-lg-4 col-md-6 col-sm-6 themes-img">
                                <MediaCard
                                    // Title={object.title}
                                    Image="{object.img_url}"
                                    Desc="{object.desc}"
                                />
                            </div>
                            {/* })} */}
                            <Button> <a style={anchorStyle} href="/themes"> <ArrowBackIcon /> All Themes </a> </Button>

                        </div>
                    </div>
                    <Scripts></Scripts>
                </div>
            );
        }
    }
};

export default Project;
